import React from 'react';
import {Jumbotron as Jumbo, Container, Image, Carousel} from 'react-bootstrap';
import styled from 'styled-components';
import bkg from '../assets/florarie.png';
import mino from '../assets/mino-copy.png';
import bkg2 from '../assets/florarie2-copy.png';

const Styles = styled.div`
    #jumbotron1 {
        background: url(${bkg}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    #jumbotron2 {
        background: url(${mino}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    #jumbotron3 {
        background: url(${bkg2}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    .overlay {
        background-color: #000;
        opacity: 0.6;
        position: absolute;
        top: 0;
        left: 0;
        bottom: 0;
        right: 0;
        z-index: -1;
    }

    #jumbotron1 h2 {
        font-size: 30;
    }
`;

export const Jumbotron = () => (
    <Styles>
        <Carousel >
            <Carousel.Item id="jumbotron1">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2>Livrari la domiciliu</h2>
                <p>Oricand la dispozitia ta!</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item id="jumbotron2">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2>Second slide label</h2>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item id="jumbotron3">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2>Third slide label</h2>
                <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    </Styles>
)
